type StdOutWriter struct{}

func (writer StdOutWriter) Write(outputChannel *chan UseFulMftFields, waitGroup *sync.WaitGroup) (err error) {
	openChannel := true
	for openChannel != false {
		var record UseFulMftFields
		record, openChannel = <-*outputChannel
		fmt.Printf("%+v\n", record)
	}
	waitGroup.Done()
	return
}

